import React from 'react';



// Initialize and add the map
function initMap() {
  // The location of Uluru
  const uluru = {
    lat: 51.064224,
    lng: 17.017063
  };
  // The map, centered at Uluru
  const map = new google.maps.Map(document.getElementById("map"), {
    zoom: 4,
    center: uluru,
  });
  // The marker, positioned at Uluru
  const marker = new google.maps.Marker({
    position: uluru,
    map: map,
  });
}

const MapSection = () => {


  return (
    <>
      <div id="map"></div>


      <script
        src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDgTDE3UDZHLNa_Q9KrrKii-eMpsPVvokM&callback=initMap&libraries=&v=weekly"
        async
      ></script>
    </>
  );
};
export default MapSection;
